{{#if isNewAddress}}
	{{!-- <a class="address-details-new-address" href="/addressbook/new" data-toggle="show-in-modal">
		<div class="address-details-new-address-title">
			<p><i class="address-details-new-address-plus-icon"></i></p>
			{{translate 'Add Address'}}
		</div>
	</a> --}}
{{else}}
	{{#if showSelector}}
		<a class="address-details-selector {{#if isSelected}}address-details-selected{{/if}}" data-action="select" data-id="{{internalid}}">
			<input type="radio" name="address-options-{{manageOption}}" class="address-details-selector-option" data-id="{{internalid}}" value="{{internalid}}" {{#if isSelected}} checked {{/if}}>
			{{#if isSelected}}
				<b>{{translate 'Selected'}}</b>
			{{else}}
				{{translate 'Select'}}
			{{/if}}
		</a>
	{{/if}}

	<div class="address-details {{#if isSelected}}address-details-selected{{/if}}">
		<div class="address-details-container" data-id="{{internalid}}" {{#if isManageOptionsSpecified}} data-manage="{{manageOption}}" {{/if}}>
			<address>
				{{#if showMultiSelect}}
					<div class="address-details-container-multiselect-address-selector" >
						<label class="address-details-container-multiselect-address-selector-checkbox">
							<input type="checkbox" {{#if isAddressCheck}} 'checked' {{/if}} data-id="{{internalid}}" data-action="multi-select-address"></input>
						</label>
					</div>
				{{/if}}

				<div class="address-details-info{{#if showMultiSelect}} address-details-container-multiselect-address {{/if}}">
					<p class="address-details-container-multiselect-address-title" data-name="company">
						<b>{{title}}</b>
					</p>
					{{#if showCompanyAndFullName}}
						<p class="address-details-container-multiselect-address-company" data-name="company">
							{{company}}
						</p>
						<p class="address-details-container-multiselect-address-name" data-name="fullname">
							{{fullname}}
						</p>
					{{else}}
						{{#if showFullNameOnly}}
							<span class="address-details-address-name" data-name="fullname">
								{{fullname}}
							</span>
						{{/if}}
					{{/if}}
					<p class="address-details-container-multiselect-address-details-addr1" data-name="addr1">
						{{addressLine1}}{{#if showAddressLine1}} {{addressLine2}}{{/if}}
					</p>
					{{!-- {{#if showAddressLine1}}
						<p class="address-details-container-multiselect-address-details-addr2" data-name="addr2">
							{{addressLine2}}
						</p>
					{{/if}} --}}
					<p class="address-details-container-multiselect-address-line">
						<span class="address-details-container-multiselect-address-zip" data-name="zip">
							{{zip}}
						</span>
						<span class="address-details-container-multiselect-address-details-city" data-name="city">
							{{city}}
						</span>
						{{#if showState}}
							<span class="address-details-container-multiselect-address-details-state" data-name="state">
								{{state}}
							</span>
						{{/if}}
					</p>
					<p class="address-details-country" data-name="country">
						{{country}}
					</p>
					<p class="address-details-phone" data-name="phone">
						<a href="tel:{{phone}}">{{phone}}</a>
					</p>
				</div>
			</address>

			{{#if showDefaultLabels}}
				{{#if isDefaultShippingAddress}}
				<p class="address-details-default-shipping">
					<i class="address-details-default-shipping-icon"></i>
					{{translate 'Default Shipping Address'}}
				</p>
				{{/if}}

				{{#if isDefaultBillingAddress}}
				<p class="address-details-default-billing">
					<i class="address-details-default-shipping-icon"></i>
					{{translate 'Default Billing Address'}}
				</p>
				{{/if}}
			{{/if}}

			{{!-- {{#if showActionButtons}}
			<p class="address-details-actions">
				<a class="address-details-action" href="/addressbook/{{internalid}}" data-action="edit-address" data-id="{{internalid}}" data-toggle="show-in-modal">
					{{translate 'Edit'}}
				</a>
				{{#if showRemoveButton}}
					<button class="address-details-action" data-action="remove" data-id="{{internalid}}" {{#if isInvalidAddressToRemove}}disabled{{/if}}>
						{{translate 'Remove'}}
					</button>
					{{#if isInvalidAddressToRemove}}
						<i class="address-details-info-icon" data-toggle="tooltip" title="{{translate 'You cannot remove this address because it was already assigned to a shipment'}}"></i>
					{{/if}}
				{{/if}}
			</p>
			{{/if}} --}}

			{{#if showError}}
				<div data-type="address-details-error-container">
					<div class="address-details-error-message">{{translate 'Invalid address, please provide the following:'}}</div>
					{{#each invalidAttributes}}
						<div class="address-details-error-message"> - {{this}} </div>
					{{/each}}
				</div>
			{{/if}}
		</div>
	</div>
{{/if}}




{{!----
Use the following context variables when customizing this template:

	model (Object)
	model.internalid (String)
	model.country (String)
	model.state (String)
	model.city (String)
	model.zip (String)
	model.addr1 (String)
	model.addr2 (String)
	model.phone (String)
	model.fullname (String)
	model.company (String)
	model.isvalid (String)
	internalid (String)
	isManageOptionsSpecified (Boolean)
	isAddressCheck (Boolean)
	title (String)
	showCompanyAndFullName (Boolean)
	company (String)
	fullname (String)
	showFullNameOnly (Boolean)
	addressLine1 (String)
	showAddressLine1 (Boolean)
	addressLine2 (String)
	city (String)
	showState (Boolean)
	state (String)
	zip (String)
	country (String)
	phone (String)
	showDefaultLabels (Boolean)
	isDefaultShippingAddress (Boolean)
	isDefaultBillingAddress (Boolean)
	showSelectionButton (Boolean)
	isASelectMessageSpecified (Boolean)
	showActionButtons (Boolean)
	showChangeButton (Boolean)
	showRemoveButton (Boolean)
	invalidAttributes (Array)
	isInvalidAddressToRemove (Boolean)
	manageOption (String)
	showError (Boolean)
	showMultiSelect (Boolean)
	selectMessage (String)

----}}

.order-history-packages-header-container-title{
	position: relative;
	display: inline-block;
	white-space: nowrap;



	@media (max-width: $screen-xs-min) {
		padding: 0 $sc-padding-lv2;
		display: block;
		white-space: break-spaces !important;
	}
}
.order-history-packages-header-container{
	display: block;
    width: 100%;
    line-height: normal;
    padding-bottom: $sc-padding-lv2;

	@media (min-width: $screen-xs-min) {
		display: table;
		border-bottom:1px solid $sc-color-theme-border-light;
	}

	@media (max-width: $screen-xs-min) {
		padding-left: $sc-padding-lv2;
		padding-right: $sc-padding-lv2;
	}

}

.order-history-packages-header-container .order-history-list-tracking-number-label,
.order-history-packages-header-container .order-history-list-tracking-number-available-label,
.order-history-packages-header-container .order-history-list-tracking-number-control-numbers-link {
	font-size: $sc-font-size-s;
	line-height: $sc-font-size-s*2;
}

.order-history-packages-header-container-left{


	@media (min-width: $screen-xs-min) {
		float: left;
		max-width: 50%;
	}
}

.order-history-packages-header-container-right{
	@media (min-width: $screen-xs-min) {
		float: right;
		text-align: right;
		max-width: 50%;
	}
}

.order-history-packages-delivery-label{
	@extend .sc-label;
	font-size: $sc-font-size-s;
	line-height: $sc-font-size-s*2;
}

.order-history-packages-delivery-value{
	@extend .sc-value;
	line-height: $sc-font-size-s*2;
}

.order-history-packages-shipped-date-label{
	@extend .sc-label;
	line-height: $sc-font-size-s*2;
}
.order-history-packages-shipped-date-value{
	@extend .sc-value;
	line-height: $sc-font-size-s*2;
}

.order-history-packages-shipped-status-value{
	@extend .sc-value;
	line-height: $sc-font-size-s*2;
}
.order-history-packages-shipped-status-label{
	@extend .sc-label;
	line-height: $sc-font-size-s*2;
}

.order-history-packages-accordion-container {
	@extend .order-history-details-accordion-container;
	.transaction-line-views-cell-actionable-line-tr{
		margin-bottom:$sc-margin-lv2;
	}
}

.order-history-packages-items-table{
	@extend .transaction-line-views-cell-actionable-table;

	.item-view-actionable-selected-option-cell {
		padding-left: 0;
	}
}

.order-history-packages-container {
	border-bottom:1px solid $sc-color-theme-border-light;
	margin-bottom:$sc-margin-lv3;
}

.order-history-packages-container:last-child {
		border-bottom:0;
}



.order-history-packages-accordion-head{
	@extend .accordion-head;
}

.order-history-packages-accordion-head-toggle{
	@extend .accordion-head-toggle;
	color: black;
	font-weight: normal;
	border-bottom: none;
	position: relative;

	&.collapsed{
		border-bottom: 1px solid $sc-color-theme-border;

		.order-history-packages-hide-from-head{
			display: none;
		}

		.order-history-packages-header-container{
			border-bottom: none;
		}
	}

	@media (max-width: $screen-xs-min){
    	padding: 0;
    }

	.order-history-packages-accordion-head-toggle-status {
		line-height: inherit;
		vertical-align: middle;
		color: $sc-color-primary;
	}

	.order-history-packages-accordion-head-toggle-auxiliar-text {
		line-height: inherit;
		vertical-align: middle;
	}
}

.order-history-packages-accordion-toggle-icon{
	@extend .accordion-toggle-icon;
	position: absolute;
	bottom: 0;
	right: $sc-padding-lv2;

	@media (min-width: $screen-xs-min){
    	bottom: auto;
		top: 0;
		right: $sc-padding-lv4;
    }
}

.order-history-packages-accordion-body{
	@extend .accordion-body;
}

.order-history-packages-accordion-body-no-header{
	@extend .accordion-body;
	border-top: 1px solid $sc-color-theme-border-light;
}

.order-history-packages-acordion-divider{
	@extend .accordion-divider;
}

.order-history-packages-accordion-container{
	@extend .accordion-container;
}

.order-history-packages-dropdown {
    @extend .dropdown;
    font-size: $sc-font-size-s;
    padding: $sc-padding-lv3 $sc-padding-lv4;
    line-height: 1.2em;
    background-color: $sc-color-theme-background;

	&.open .order-history-packages-address-data-link{
		color: $sc-color-link;
	}
}

.order-history-packages-dropdown-menu {
    @extend .dropdown-menu;
    font-weight: normal;
    line-height: normal;
    top: auto;
    left: auto;
    border-radius: 0;
	border-color: $sc-color-theme-border;
	@include box-shadow(1px 1px 1px rgba(0, 0, 0, 0.176));
	padding: $sc-padding-lv2;

	@media (min-width: $screen-sm-min){
    	right: 0;
    }

    .locator-venue-details-container *{
	    font-size: $sc-font-size-s;
	    line-height: 1.6;
	}
}

.order-history-packages-dropdown-menu  .address-details {
	background: none;
	border: none;
	padding: 0;
	min-height: 0;

	.address-details-container {
		padding: 0;
	}

	p {
		font-size: $sc-font-size-s;
	}

	.address-details-info {
		margin-bottom: 0;
	}
}

.order-history-packages-icon-angle-down {
	@extend .icon-angle-down;
	position: absolute;
	right: 0;
	line-height: inherit;
	top: 0;
}

.order-history-packages-address-label{
	color: $sc-color-copy-light;
}

.order-history-packages-address-data-link {
	color: $sc-color-link;
    cursor: pointer;
    display: inline-block;
    vertical-align: middle;
    position: relative;
    padding-right: $sc-padding-lv3;

	&:hover, &:focus{
		color: $sc-color-link-hover;
	}

    @media (max-width: $screen-xs-min - 1){
    	max-width: 40%;
    	text-overflow: ellipsis;
    	white-space: nowrap;
    	overflow: hidden;
    }
}

.order-history-packages-items-table .transaction-line-views-cell-actionable-table-middle {
	display: block;
}

.order-history-packages-items-table .transaction-line-views-cell-actionable-table-last {
	display: block;
	width: auto;
	padding: 0 $sc-padding-lv3;
}

.order-history-packages-header-col, .order-history-packages-header-container-right .order-history-list-tracking-number-control-numbers-link{
	max-width: 100%;
    text-overflow: ellipsis;
    white-space: nowrap;
    overflow: hidden;
}

.order-history-packages-items-quantity{
	display: block;
	background:$sc-color-theme-background;
	padding: 0 $sc-padding-lv2;
	color: $sc-color-secondary;

	@media (min-width: $screen-xs-min){
    	display: none;
    }

}

.order-history-packages-get-directions-button {
	@extend .button-tertiary;
    @extend .button-small;
    margin-top: $sc-margin-lv2;
}

.order-history-packages-items-table .transaction-line-views-cell-actionable-free-badge{
	@media (min-width: $screen-xs-min){
    	position: absolute;
    	margin: 0;
    }
}

.order-wizard-paymentmethod-selector-module {
	@extend .box-column;

	.creditcard-edit-form {
	  clear: both;
	}
	.creditcard-edit-form-securitycode {
		padding: 0;
	}
	display: none;
}

.order-wizard-paymentmethod-selector-module-header {
	margin-bottom: $sc-margin-lv3;
	color: $sc-color-theme-700;
}

.order-wizard-paymentmethod-selector-module-header-nav {
	margin-bottom: $sc-margin-lv4;
	position:relative;
}

.order-wizard-paymentmethod-selector-module-button-group {
	@extend .pill-button-group;
}

.order-wizard-paymentmethod-selector-module-button {
	@extend .button-medium;
	@extend .pill-button;	
}

.order-wizard-paymentmethod-selector-module-button.selected {
	@extend .pill-button-active;
}
